import React, { Component } from 'react'
import Slider from 'react-slick';
export default class Homeslider extends Component {
    render() {
        const settings = {
          dots: true,
          infinite: true,
          speed: 500,
          slidesToShow: 1,
          slidesToScroll: 1
        };
        return (
          <div style={{textAlign:'center'}}>
            <h2> Single Item</h2>
            <Slider {...settings}>
              <div>
                <h3>1</h3>
                <img src="https://unsplash.it/1500/599?random" />
              </div>
             
              <div>
                <h3>5</h3>
                <img src="https://unsplash.it/1500/599?random" />
              </div>
              <div>
                <h3>6</h3>
                <img src="https://unsplash.it/1500/599?random" />
              </div>
            </Slider>
          </div>
        );
      }
}
